import "./App.css";

function App() {
  const axios = require("axios");

  const options = {
    method: "GET",
    url: "https://spotify23.p.rapidapi.com/search/",
    params: {
      q: "<REQUIRED>",
      type: "multi",
      offset: "0",
      limit: "10",
      numberOfTopResults: "5",
    },
    headers: {
      "X-RapidAPI-Key": "7ab16f8d34msha79dfa1cd589bc7p1260cajsn88f085efc362",
      "X-RapidAPI-Host": "spotify23.p.rapidapi.com",
    },
  };

  axios
    .request(options)
    .then(function (response) {
      console.log(response.data);
    })
    .catch(function (error) {
      console.error(error);
    });
  return (
    <div className="App">
      <h1>Hello mother Fuckers</h1>
    </div>
  );
}

export default App;
